	public static class RunningBalance extends ArrayList<Object> {
		private String name;
		private int xxx;
		private Amount amount;
		public String getName() {
			return name;
		}
		public void setName(String name) {
			this.name = name;
		}
		public int getXxx() {
			return xxx;
		}
		public void setXxx(int xxx) {
			this.xxx = xxx;
		}
		public Amount getAmount() {
			return amount;
		}
		public void setAmount(Amount amount) {
			this.amount = amount;
		}
		
		private static final long serialVersionUID = 1L;
		public RunningBalance convert() {
			for (Object obj : this) {
				if (obj instanceof String) {
					name = (String) obj;
				} else if (obj instanceof List) {
					amount = new Amount();
					@SuppressWarnings("unchecked")
					List<List<Object>> temp = (List<List<Object>>) obj;
					for (List<Object> t1 : temp) {
						for (Object t2 : t1) {
							if (t2 instanceof Integer) {
								xxx = (Integer) t2;
							} else if (t2 instanceof LinkedHashMap<?, ?>) {
								@SuppressWarnings("unchecked")
								LinkedHashMap<String, ?> t3 = (LinkedHashMap<String, ?>) t2;
								amount.setAsset_id(getInteger(t3.get("asset_id")));
								amount.setValue(getLong(t3.get("amount")));
							}
						}
					}
				}
			}
			return this;
		}
	}
	
	private List<Result> result;

	public void setResult(List<Result> result) {
		this.result = result;
	}

	public List<Result> getResult() {
		for (Result r : result)
			for (LedgerEntry entry : r.ledger_entries)
				for (RunningBalance balance : entry.running_balances)
					balance.convert();
		return result;
	}
	
	private static final String COMMAND = "wallet_account_transaction_history";
	
	
	public static CommandJson test(String name, String assetSymbol, int limit) {
		return doTest(COMMAND, new Object[] { name, assetSymbol });
	}
	
	public static List<WalletAccountTransactionHistory.Result> run(String name, String assetSymbol, int limit) throws BTSSystemException {
		return run(0, name, assetSymbol, limit);
	}
	public static List<WalletAccountTransactionHistory.Result> run(int id, String name, String assetSymbol, int limit) throws BTSSystemException {
		WalletAccountTransactionHistory i = (WalletAccountTransactionHistory) new WalletAccountTransactionHistory().doRun(id, COMMAND,
				new Object[] { name, assetSymbol, limit});
		i.checkSystemException();
//		for (Result result : i.getResult())
//			if (result.getError() != null)
//				System.out.println(result.getTrx_id());
		return i.getResult();
	}

